rt for WooCommerce 4.6</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n            <li>Dev: added yith_wcbm_product_thumbnail_allowed_html filter</li>\n        </ul>\n        <h4>1.4.4 - Released on 17 Sep 2020</h4>\n        <ul>\n            <li>New: support for WooCommerce 4.5</li>\n            <li>Fix: support for YITH WooCommerce Dynamic Pricing and Discounts</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n        </ul>\n        <h4>1.4.3 - Released on 03 Jul 2020</h4>\n        <ul>\n            <li>New: support for WooCommerce 4.3</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n        </ul>\n        <h4>1.4.2 - Released on 20 May 2020</h4>\n        <ul>\n            <li>New: support for WooCommerce 4.2</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n            <li>Dev: added yith_wcbm_valid_product_to_apply_with_other_variations filter</li>\n        </ul>\n        <h4>1.4.1 - Released on 24 April 2020</h4>\n        <ul>\n            <li>New: support to WooCommerce 4.1</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n            <li>Fix: integration with Flatsome</li>\n            <li>Tweak: prevent issues when hiding sale badges</li>\n        </ul>\n        <h4>1.4.0 - Released on 24 March 2020</h4>\n        <ul>\n            <li>Fix: admin language issue in product categories in combination with WPML</li>\n            <li>Fix: category badge issues in combination with WPML</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n            <li>Tweak: prevent ''non well formed numeric value'' errors</li>\n        </ul>\n        <h4>1.3.27 - Released on 27 February 2020</h4>\n        <ul>\n            <li>New: support for WordPress 5.4</li>\n            <li>New: support for WooCommerce 4.0</li>\n            <li>New: support for YITH Proteo theme</li>\n            <li>Fix: admin language issue in combination with WPML</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n            <li>Dev: added yith_wcbm_get_badge_filters filter</li>\n        </ul>\n        <h4>1.3.26 - Released on 20 December 2019</h4>\n        <ul>\n            <li>New: support for WooCommerce 3.9</li>\n            <li>New: added ''yith-wcbm-product-has-badges'' CSS class to product with badges</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n            <li>Tweak: fixed issue if date column doesn''t exist</li>\n        </ul>\n        <h4>1.3.25 - Released on 5 November 2019</h4>\n        <ul>\n            <li>Update: plugin framework</li>\n        </ul>\n        <h4>1.3.24 - Released on 30 October 2019</h4>\n        <ul>\n            <li>Update: plugin framework</li>\n        </ul>\n        <h4>1.3.23 - Released on 28 October 2019</h4>\n        <ul>\n            <li>New: support for WordPress 5.3</li>\n            <li>New: support for WooCommerce 3.8</li>\n            <li>New: support for Twenty Twenty theme</li>\n            <li>New: panel style</li>\n            <li>Update: plugin framework</li>\n            <li>Fix: force positioning badges when clicking on product tabs</li>\n            <li>Dev: added yith_wcbm_number_cat_to_show filter</li>\n            <li>Dev: added yith_wcbm_category_pagination_totals filter</li>\n            <li>Dev: added yith_wcmb_wpml_autosync_product_badge_translations filter and function</li>\n        </ul>\n        <h4>1.3.22 - Released on 1 August 2019</h4>\n        <ul>\n            <li>New: support to WooCommerce 3.7</li>\n            <li>New: edit badges through Quick Edit</li>\n            <li>Fix: hidden badges on YITH Frontend Manager products section</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n        </ul>\n        <h4>1.3.21 - Released on 23 May 2019</h4>\n        <ul>\n            <li>New: support to WordPress 5.2</li>\n            <li>Update: plugin framework</li>\n            <li>Tweak: added new CSS class for anchor point position</li>\n        </ul>\n        <h4>1.3.20 - Released on 9 April 2019</h4>\n        <ul>\n            <li>New: support to WooCommerce 3.6</li>\n            <li>New: support to YITH Booking Theme</li>\n            <li>Update: language files</li>\n            <li>Update: plugin framework</li>\n        </ul>\n        <h4>1.3.19 - Released on 31 January 2019</h4>\n        <ul>\n            <li>New: Support to WooCommerce 3.5.4</li>\n            <li>Fix: textdomain for some strings</li>\n            <li>Fix: timezone issue with starting and ending date</li>\n            <li>Fix: support to YITH WooCommerce Auctions</li>\n            <li>Fix: support to YITH WooCommerce Dynamic Pricing and Discounts</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n            <li>Tweak: added CSS class to badges including the product ID</li>\n            <li>Tweak: pagination for categories in settings</li>\n            <li>Dev: added yith_wcbm_text_badge_text filter</li>\n            <li>Dev: added yith_wcbm_css_badge_text filter</li>\n        </ul>\n        <h4>1.3.18 - Released on 5 December 2018</h4>\n        <ul>\n            <li>New:  support to WordPress 5.0</li>\n            <li>Update: plugin framework</li>\n            <li>Update: language files</li>\n            <li>Tweak: prevent issues with some themes that prints each variation directly in Shop page</li>\n        </ul>\n        <h4>1.3.17 - Released on 23 October 2018</h4>\n        <ul>\n            <li>Fix: rotation for text badges</li>\n            <li>Fix: hidden badges in mini-cart of Avada theme</li>\n            <li>Update: plugin framework</li>\n        </ul>\n        <h4>1.3.16 - Released on 10 October 2018</h4>\n        <ul>\n            <li>Fix: style issue with Advanced Badges</li>\n        </ul>\n        <h4>1.3.15 - Released on 9 October 2018</h4>\n        <ul>\n            <li>New: support to WooCommerce 3.5.x</li>\n            <li>New: possibility to scale badge in mobile</li>\n            <li>New: ''Single Product Image'' option in Force Positioning settings</li>\n            <li>Fix: issue when hiding badges on Single Product pages</li>\n            <li>Fix: hidden badges in YITH WooCommerce Added to Cart Popup</li>\n            <li>Fix: round saved price</li>\n            <li>Fix: hidden badges in Orders on AJAX call</li>\n            <li>Tweak: prevent duplicate badges</li>\n            <li>Tweak: prevent issues with some themes</li>\n            <li>Update: Dutch language</li>\n            <li>Dev: added yith_wcbm_print_container_image_and_badge filter</li>\n        </ul>\n        <h4>1.3.14 - Released on 26 June 2018</h4>\n        <ul>\n            <li>Fix: support to YITH WooCommerce Dynamic Pricing and Discounts</li>\n            <li>Fix: support to YITH WooCommerce Auctions</li>\n            <li>Fix: issues if the yith_wcmb_get_badges_premium is used with the third deprecated param</li>\n            <li>Tweak: prevent issues on iOS devices</li>\n        </ul>\n        <h4>1.3.13 - Released on 24 June 2018</h4>\n        <ul>\n            <li>New: possibility to set multiple badge specific for each product</li>\n            <li>New: option to force badge positioning through JS to prevent some theme issues</li>\n            <li>Fix: style issue in combination with Flatsome theme</li>\n        </ul>\n        <h4>1.3.12 - Released on 31 May 2018</h4>\n        <ul>\n            <li>New: support to WooCommerce 3.4.x</li>\n            <li>New: support to WordPress 4.9.6</li>\n            <li>Update: Italian language</li>\n            <li>Update: Spanish language</li>\n            <li>Update: plugin framework</li>\n            <li>Fix: print only published badges</li>\n            <li>Fix: badge column style in Product list</li>\n            <li>Tweak: added version in styles</li>\n        </ul>\n        <h4>1.3.11 - Released on 28 February 2018</h4>\n        <ul>\n            <li>Fix: issue in WooCommerce gallery</li>\n            <li>Fix: on-sale badge issue with themes</li>\n            <li>Dev: added yith_wcmb_is_wpml_parent_based_on_default_language function</li>\n            <li>Dev: added yith_wcmb_is_wpml_parent_based_on_default_language filter</li>\n        </ul>\n        <h4>1.3.10 - Released on 1 February 2018</h4>\n        <ul>\n            <li>Fix: issues in combination with Yoast SEO plugin</li>\n            <li>Fix: enqueue styles and scripts only where needed</li>\n            <li>Tweak: prevent warning in advanced badges</li>\n        </ul>\n        <h4>1.3.9 - Released on 31 January 2018</h4>\n        <ul>\n            <li>New: support to WooCommerce 3.3</li>\n            <li>New: Low stock badge</li>\n            <li>New: enable shop manager to edit options</li>\n            <li>New: Dutch language</li>\n            <li>Update: Plugin Framework</li>\n            <li>Fix: product metabox style</li>\n            <li>Fix: rotation issue with advanced badges</li>\n            <li>Dev: added yith_wcbm_product_is_on_sale_based_on_woocommerce filter</li>\n        </ul>\n        <h4>1.3.8 - Released on 30 December 2017</h4>\n        <ul>\n            <li>Fix: removed yith-wcbm-clearfix from badge container by default</li>\n            <li>Dev: added yith_wcbm_container_image_and_badge_extra_classes filter</li>\n        </ul>\n        <h4>1.3.7 - Released on 29 December 2017</h4>\n        <ul>\n            <li>New: support to eStore theme</li>\n            <li>New: support to Total theme</li>\n            <li>New: support to Shopkeeper theme</li>\n            <li>New: French translation (thanks to Pierre-Yves QUEMENER)</li>\n            <li>Tweak: added yith-wcbm-clearfix class to container-image-and-badge</li>\n            <li>Update: Plugin Framework 3</li>\n            <li>Fix: WPML integration</li>\n            <li>Fix: YITH WooCommerce Dynamic Pricing and Discounts integration</li>\n            <li>Fix: enqueue styles and scripts in admin Badge pages only</li>\n            <li>Fix: prevent deleting badge issue on WP bulk editing products</li>\n            <li>Fix: theme integrations</li>\n            <li>Fix: rotation issues</li>\n            <li>Fix: removed http and https protocols in image url to prevent issues</li>\n            <li>Dev: theme compatibility refactoring</li>\n            <li>Dev: added yith_wcbm_clearfix_class filter</li>\n        </ul>\n        <h4>1.3.6 - Released on 11 October 2017</h4>\n        <ul>\n            <li>New: support to Support to WooCommerce 3.2.0 RC2</li>\n            <li>New: support to Electro theme</li>\n            <li>New: possibility to set width and height as ''auto'' in text badges</li>\n            <li>Fix: badge dragging issue</li>\n            <li>Fix: width, height and line height issues in text badges</li>\n            <li>Fix: WPML integration</li>\n        </ul>\n        <h4>1.3.5 - Released on 10 August 2017</h4>\n        <ul>\n            <li>Fix: flip text issue in Safari</li>\n            <li>Fix: flip text issue in css badges</li>\n            <li>Fix: changed hook priority to prevent issues</li>\n        </ul>\n        <h4>1.3.4 - Released on 29 June 2017</h4>\n        <ul>\n            <li>New: 3D rotation</li>\n            <li>New: Flip badge text horizontally and vertically</li>\n            <li>Fix: discount calculation issue</li>\n            <li>Fix: use woocommerce_single_product_image_thumbnail_html filter</li>\n            <li>Fix: on-sale badge issue with variable products</li>\n            <li>Fix: badge style issue</li>\n            <li>Fix: badge preview class</li>\n            <li>Dev: added yith_wcbm_image_badge_url filter</li>\n            <li>Tweak: fixed plugin documentation link</li>\n        </ul>\n        <h4>1.3.3 - Released on 9 May 2017</h4>\n        <ul>\n            <li>Fix: badge saving</li>\n            <li>Fix: hidden badges in feeds</li>\n            <li>Tweak: removed badges in wishlist table of YITH WooCommerce Wishlist</li>\n            <li>Dev: added yith_wcbm_get_badge_premium filter</li>\n        </ul>\n        <h4>1.3.2 - Released on 11 April 2017</h4>\n        <ul>\n            <li>New: support to WooCommerce 3.0.1</li>\n            <li>Fix: post thumbnail issue</li>\n        </ul>\n        <h4>1.3.1 - Released on 5 April 2017</h4>\n        <ul>\n            <li>New: support to WooCommerce 3.0.0</li>\n            <li>Fix: badge saving</li>\n            <li>Fix: issue in combination with YITH WooCommerce Catalog Mode</li>\n            <li>Fix: hidden badges in YITH WooCommerce Request a Quote widget</li>\n            <li>Fix: Basel theme compatibility issue</li>\n            <li>Fix: percentage discount issue</li>\n            <li>Fix: YITH WooCommerce Dynamic Pricing and Discounts integration issue</li>\n        </ul>\n        <h4>1.3.0 - Released on 6 March 2017</h4>\n        <ul>\n            <li>New: support to WooCommerce 2.7.0-RC1</li>\n            <li>New: shortcode yith_badge_container</li>\n            <li>New: Basel theme support</li>\n            <li>Tweak: improved theme compatibility</li>\n            <li>Dev: added new class to easily add support to themes</li>\n        </ul>\n        <h4>1.2.30 - Released on 19 January 2017</h4>\n        <ul>\n            <li>New: choose whether showing the discount amount or percentage in advanced badges</li>\n            <li>Fix: integration with YITH WooCommerce Dynamic Pricing and Discounts</li>\n            <li>Fix: issues in combination with YITH WooCommerce Quick View</li>\n        </ul>\n        <h4>1.2.29 - Released on 13 January 2017</h4>\n        <ul>\n            <li>New: badge preview in admin badge list</li>\n            <li>Tweak: prevent issue with themes that don''t use the "woocommerce_single_product_image_html" and "post_thumbnail_html" filters without the second parameter</li>\n        </ul>\n        <h4>1.2.28 - Released on 2 January 2017</h4>\n        <ul>\n            <li>Fixed: advanced badge issues</li>\n        </ul>\n        <h4>1.2.27 - Released on 23 December 2016</h4>\n        <ul>\n            <li>Added: duplicate badges</li>\n            <li>Added: Flatsome support</li>\n            <li>Fixed: removed badge permalink</li>\n            <li>Fixed: old PHP version issues</li>\n            <li>Fixed: advanced badge styles</li>\n        </ul>\n        <h4>1.2.26 - Released on 7 November 2016</h4>\n        <ul>\n            <li>Added: support to YITH WooCommerce Role Based Prices</li>\n            <li>Fixed: localization of 2 advanced badges</li>\n        </ul>\n        <h4>1.2.25 - Released on 24 October 2016</h4>\n        <ul>\n            <li>Fixed: advanced badge issue</li>\n            <li>Fixed: automatic on-sale badge issue</li>\n            <li>Dev: added filter yith_wcbm_show_featured_badge_on_product</li>\n            <li>Dev: added filter yith_wcbm_show_on_sale_badge_on_product</li>\n            <li>Dev: added filter yith_wcbm_show_out_of_stock_badge_on_product</li>\n        </ul>\n        <h4>1.2.24 - Released on 18 October 2016</h4>\n        <ul>\n            <li>Fixed: issue in combination with YITH Auctions for WooCommerce and YITH WooCommerce Dynamic Pricing and Discounts</li>\n        </ul>\n        <h4>1.2.23 - Released on 18 October 2016</h4>\n        <ul>\n            <li>Added: integration with YITH Auctions for WooCommerce 1.0.10</li>\n            <li>Added: support to YITH WooCommerce Dynamic Pricing and Discounts</li>\n            <li>Fixed: issue in combination with Storefront Sticky Add to Cart</li>\n            <li>Fixed: css badge class</li>\n            <li>Dev: added yith_wcbm_advanced_badge_info filter</li>\n        </ul>\n        <h4>1.2.22 - Released on 20 July 2016</h4>\n        <ul>\n            <li>Added: show badges based on currently selected language using WPML</li>\n            <li>Added: Spanish language</li>\n        </ul>\n        <h4>1.2.21 - Released on 20 June 2016</h4>\n        <ul>\n            <li>Added: choose how to show advanced badges in variable products</li>\n            <li>Fixed: prevent issues if shop manager (or administrator) role doesn''t exist</li>\n            <li>Fixed: advanced badge bug</li>\n        </ul>\n        <h4>1.2.20 - Released on 3 June 2016</h4>\n        <ul>\n            <li>Fixed: compatibility issue with YITH WooCommerce Dynamic Pricing and Discount Premium</li>\n        </ul>\n        <h4>1.2.19 - Released on 19 May 2016</h4>\n        <ul>\n            <li>Added: Italian language</li>\n            <li>Fixed: badge text and style</li>\n        </ul>\n        <h4>1.2.18 - Released on 2 May 2016</h4>\n        <ul>\n            <li>Fixed: badges in YITH WooCommerce Recently Viewed Products emails hidden because causing graphical issues</li>\n            <li>Fixed: badges in YITH WooCommerce Questions and Answers emails hidden because causing graphical issues</li>\n        </ul>\n        <h4>1.2.17 - Released on 29 April 2016</h4>\n        <ul>\n            <li>Added: support to WordPress 4.5.1</li>\n            <li>Fixed: badges in YITH WooCommerce Waiting List emails hidden because causing graphical issues</li>\n        </ul>\n        <h4>1.2.16 - Released on 26 April 2016</h4>\n        <ul>\n            <li>Tweak: hidden badges in ajax search box</li>\n            <li>Tweak: prevent badges from showing in WooCommerce emails</li>\n            <li>Fixed: badge css styles</li>\n        </ul>\n        <h4>1.2.15 - Released on 20 April 2016</h4>\n        <ul>\n            <li>Tweak: localized "Discount" text</li>\n            <li>Fixed: advanced badge display price including/excluding tax</li>\n        </ul>\n        <h4>1.2.14 - Released on 15 March 2016</h4>\n        <ul>\n            <li>Added: possibility to set shipping class badges</li>\n            <li>Fixed: advanced badge styles</li>\n        </ul>\n        <h4>1.2.13 - Released on 10 March 2016</h4>\n        <ul>\n            <li>Fixed: advanced badge styles</li>\n        </ul>\n        <h4>1.2.12 - Released on 8 March 2016</h4>\n        <ul>\n            <li>Tweak: fixed bug with badges on variable products</li>\n        </ul>\n        <h4>1.2.11 - Released on 29 February 2016</h4>\n        <ul>\n            <li>Tweak: hidden wpml translated badge in select fields of Badge Management settings</li>\n            <li>Tweak: fixed minor bug</li>\n        </ul>\n        <h4>1.2.10 - Released on 16 February 2016</h4>\n        <ul>\n            <li>Tweak: hidden badges in YITH WooCommerce Frequently Bought Together form</li>\n            <li>Tweak: hidden badges in YITH WooCommerce Save for Later section</li>\n        </ul>\n        <h4>1.2.9 - Released on 8 February 2016</h4>\n            <ul>\n                <li>Tweak: fixed minor bugs</li>\n            </ul>\n        <h4>1.2.8 - Released on 4 February 2016</h4>\n            <ul>\n                <li>Added: possibility to set badges for price rules of YITH WooCommerce Dynamic Pricing and Discount Premium 1.0.3</li>\n                <li>Tweak: fixed hidden badges in Single Product Page</li>\n                <li>Tweak: fixed badge style W3C</li>\n            </ul>\n        <h4>1.2.7 - Released on 22 January 2016</h4>\n            <ul>\n                <li>Added: support to WordPress 4.4.1</li>\n                <li>Added: support to WooCommerce 2.5</li>\n                <li>Tweak: hidden badges in WooCommerce mini-cart</li>\n                <li>Tweak: fixed minor bug</li>\n            </ul>\n        <h4>1.2.6 - Released on 31 December 2015</h4>\n            <ul>\n                <li>Added: support to WooCommerce 2.5 BETA 3</li>\n                <li>Tweak: fixed css bug with YITH WooCommerce Frequently Bought Together</li>\n                <li>Tweak: fixed minor bug</li>\n            </ul>\n        <h4>1.2.5 - Released on 18 December 2015</h4>\n        <ul>\n            <li>Added: support to WordPress 4.4</li>\n            <li>Added: support to WooCommerce 2.4.12</li>\n            <li>Added: possibility to show/hide badges in sidebars</li>\n            <li>Added: possibility to show/hide WooCommerce default "On Sale" badge when the product has another badge.</li>\n            <li>Added: advanced badge management for variable product (that have same discount percentage)</li>\n        </ul>\n        <h4>1.2.4 - Released on 10 December 2015</h4>\n         <ul>\n            <li>Added: Bulk Actions to add badge to products</li>\n             <li>Added: Badge column in product list</li>\n             <li>Tweak: fixed option to hide badges in single product page</li>\n         </ul>\n        <h4>1.2.3 - Released on 3 December 2015</h4>\n         <ul>\n             <li>Added: automatic Out of Stock badges</li>\n             <li>Added: compatibility with YITH WooCommerce Multi Vendor version 1.7.4 or greater</li>\n             <li>Tweak: fix minor bug about showing badges on products</li>\n         </ul>\n        <h4>1.2.2 - Released on 9 November 2015</h4>\n            <ul>\n                <li>Tweak: now you can schedule badge showing in product edit page</li>\n            </ul>\n        <h4>1.2.1 - Released on 28 October 2015</h4>\n            <ul>\n                <li>Fixed: minor bug</li>\n            </ul>\n        <h4>1.2.0 - Released on 8 September 2015</h4>\n            <ul>\n                <li>Added: WPML Compatibility to localize all elements of the badges</li>\n            </ul>\n        <h4>1.1.10 - Released on 28 August 2015</h4>\n            <ul>\n                <li>Fixed: minor bugs</li>\n            </ul>\n        <h4>1.1.9 - Released on 21 August 2015</h4>\n            <ul>\n                <li>Fixed: removed badges in cart and checkout</li>\n                <li>Fixed: minor bugs</li>\n            </ul>\n        <h4>1.1.8 - Released on 19 August 2015</h4>\n            <ul>\n                <li>Added: Support to WordPress 4.3</li>\n                <li>Fixed: WPML css badge text bug</li>\n            </ul>\n        <h4>1.1.7 - Released on 14 August 2015</h4>\n            <ul>\n                <li>Added: Support to WooCommerce 2.4.4</li>\n            </ul>\n        <h4>1.1.6 - Released on 12 August 2015</h4>\n            <ul>\n                <li>Added: Support to WordPress 4.2.4</li>\n                <li>Added: Support to WooCommerce 2.4.2</li>\n                <li>Fixed: WPML deprecated functions</li>\n            </ul>\n        <h4>1.1.5 - Released on 24 July 2015</h4>\n            <ul>\n                <li>Added: WPML Compatibility</li>\n                <li>Added: Compatibility with more themes</li>\n                <li>Fixed: Bug with widget sidebar on header</li>\n            </ul>\n            <h4>1.1.4 - Released on 10 July 2015</h4>\n            <ul>\n                <li>Added: Support to WooCommerce shortcodes</li>\n                <li>Fixed: Compatibility with more themes</li>\n            </ul>\n        <h4>1.1.3 - Released on 3 July 2015</h4>\n            <ul>\n                <li>Fixed: badge display in widget top related product</li>\n            </ul>\n        <h4>1.1.2 - Released on 19 June 2015</h4>\n            <ul>\n                <li>Fixed: Wrong admin css handle</li>\n            </ul>\n        <h4>1.1.1 - Released on 29 May 2015</h4>\n            <ul>\n                <li>Added: Support to WooCommce 2.3.9</li>\n                <li>Updated: Default language file</li>\n                <li>Updated: Plugin framework</li>\n                <li>Fixed: Can''t make a badge issue</li>\n                <li>Fixed: Hide on sale option not working</li>\n            </ul>\n        <h4>VERSION 1.1.0 - Released: May 08, 2015</h4>\n            <ul>\n                <li>Initial Release</li>\n            </ul>\n        \n    ";}', 'no'),
