(8743, '_site_transient_update_plugins', 'O:8:"stdClass":5:{s:12:"last_checked";i:1614322157;s:7:"checked";a:13:{s:59:"ajax-search-for-woocommerce/ajax-search-for-woocommerce.php";s:5:"1.8.2";s:33:"classic-editor/classic-editor.php";s:3:"1.6";s:97:"yikes-inc-easy-custom-woocommerce-product-tabs/yikes-inc-easy-custom-woocommerce-product-tabs.php";s:5:"1.7.6";s:29:"insert-pages/insert-pages.php";s:5:"3.5.9";s:43:"my-custom-functions/my-custom-functions.php";s:4:"4.48";s:32:"php-everywhere/phpeverywhere.php";s:5:"2.0.2";s:65:"premmerce-woocommerce-product-filter-premium/premmerce-filter.php";s:5:"3.2.4";s:58:"responsive-accordion-and-collapse/responsive-accordion.php";s:5:"2.2.3";s:33:"smart-slider-3/smart-slider-3.php";s:8:"3.4.1.16";s:27:"cyr-and-lat/cyr-and-lat.php";s:5:"1.2.0";s:27:"woocommerce/woocommerce.php";s:5:"5.0.0";s:33:"wps-hide-login/wps-hide-login.php";s:5:"1.8.3";s:50:"yith-woocommerce-badge-management-premium/init.php";s:5:"1.4.8";}s:8:"response";a:1:{s:50:"yith-woocommerce-badge-management-premium/init.php";O:8:"stdClass":13:{s:2:"id";s:50:"yith-woocommerce-badge-management-premium/init.php";s:6:"plugin";s:50:"yith-woocommerce-badge-management-premium/init.php";s:17:"yith_premium_slug";s:34:"yith-woocommerce-badges-management";s:11:"new_version";s:5:"1.4.9";s:3:"url";s:0:"";s:7:"package";s:42:"https://licence.yithemes.com/api/download/";s:5:"icons";a:1:{s:7:"default";s:91:"https://update.yithemes.com/plugins/icons/hotlink-ok/yith-woocommerce-badges-management.jpg";}s:7:"banners";a:0:{}s:11:"banners_rtl";a:0:{}s:6:"tested";s:5:"5.6.2";s:12:"requires_php";s:0:"";s:13:"compatibility";O:8:"stdClass":0:{}s:9:"changelog";s:25267:"\n        \n        <h4>1.4.9 - Released on 27 January 2021</h4>\n        <ul>\n            <li>New: support for WooCommerce 5.0</li>\n            <li>Update: YITH plugin framework</li>\n            <li>Update: language files</li>\n            <li>Fix: badge settings layout on mobile</li>\n            <li>Dev: added yith_wcbm_advan