(1678, 812, 'yikes_woo_products_tabs', 'a:3:{i:0;a:3:{s:5:"title";s:20:"Технологии";s:2:"id";s:10:"tehnologii";s:7:"content";s:1602:"<a href="http://185.224.132.110/wp-content/uploads/2021/02/1598874512_5d4bebf5-8daf-4c45-b493-e624392d0896.jpeg"><img class="alignnone size-medium wp-image-883" src="http://185.224.132.110/wp-content/uploads/2021/02/1598874512_5d4bebf5-8daf-4c45-b493-e624392d0896-300x300.jpeg" alt="" width="300" height="300" /></a>\r\n<h3>Безопасное использование</h3>\r\nВарочная панель Grundig оснащена набором функций для обеспечения вашей безопасности: защита от перелива автоматически отключает нагрев при попадании воды на сенсорную панель управления; индикатор остаточного тепла показывает, какие конфорки еще не остыли; блокировка от случайного нажатия предотвращает случайное включение панели вашими детьми.\r\n\r\n<a href="http://185.224.132.110/wp-content/uploads/2021/02/1598875191_f6cec82c-3f21-4b84-bb02-51030e2090d4.jpeg"><img class="alignnone size-medium wp-image-884" src="http://185.224.132.110/wp-content/uploads/2021/02/1598875191_f6cec82c-3f21-4b84-bb02-51030e2090d4-300x300.jpeg" alt="" width="300" height="300" /></a>\r\n<h3>Сенсорное управление</h3>\r\nИнтуитивная легкость в управлении. Удобное сенсорное управление сделает процесс приготовления еды простым и приятным.";}i:1;a:3:{s:5:"title";s:20:"Инструкция";s:2:"id";s:11:"instrukciya";s:7:"content";s:86:"<span style="color: #555555;">Нет документации по товару</span>";}i:2;a:3:{s:5:"title";s:16:"Гарантия";s:2:"id";s:9:"garantiya";s:7:"content";s:240:"Гарантия на бытовую технику Beko составляет 2 года\r\n\r\nПодробнее об условиях принятия в гарантийное обслуживание в разделе «Гарантия»";}}'),
