(1697, 814, 'yikes_woo_products_tabs', 'a:4:{i:0;a:3:{s:5:"title";s:20:"Технологии";s:2:"id";s:10:"tehnologii";s:7:"content";s:2041:"&nbsp;\r\n<h3 style="text-align: left;"><a href="http://185.224.132.110/wp-content/uploads/2021/02/1595584641_0bc88754-be49-48f0-858a-037568964648.jpeg"><img class="size-medium wp-image-872 alignleft" src="http://185.224.132.110/wp-content/uploads/2021/02/1595584641_0bc88754-be49-48f0-858a-037568964648-300x300.jpeg" alt="" width="300" height="300" /></a></h3>\r\n<img class="wp-image-873 alignright" src="http://185.224.132.110/wp-content/uploads/2021/02/1595584823_09d3a198-a181-4075-91d6-d281f1dd3f84-300x300.jpeg" alt="" width="299" height="299" />\r\n<h3 style="text-align: left;">Сенсорный дисплей</h3>\r\n<p style="text-align: left;">Удобство использования. Выбирать функции,</p>\r\n<p style="text-align: left;">включать и выключать духовой шкаф максимально</p>\r\n<p style="text-align: left;">удобно с помощью сенсорного LED дисплея.</p>\r\n<p style="text-align: left;">А двухуровневая подсветка, термощуп и</p>\r\n<p style="text-align: left;">телескопические направляющие для противня</p>\r\n<p style="text-align: left;">сделают процесс приготовления блюд еще комфортнее.</p>\r\n&nbsp;\r\n\r\n<a href="http://185.224.132.110/wp-content/uploads/2021/02/1591341783_38a62d09-44c6-4779-8467-ff33849b0d58.jpeg"><img class="alignnone size-medium wp-image-874" src="http://185.224.132.110/wp-content/uploads/2021/02/1591341783_38a62d09-44c6-4779-8467-ff33849b0d58-300x300.jpeg" alt="" width="300" height="300" /></a>\r\n<h3>Гарантия производителя 2 года</h3>\r\nНа всю продукцию Grundig действует официальная гарантия в течение 24 месяцев с момента покупки. Выезд специалиста, диагностика и ремонт при наступлении гарантийного случая будет бесплатным.";}i:1;a:3:{s:5:"title";s:20:"Инструкция";s:2:"id";s:11:"instrukciya";s:7:"content";s:418:"<a href="http://185.224.132.110/wp-content/uploads/2021/02/Duhovoj-shkaf-Grundig-GEBM19300BC.-Instrukciya-User-Manual.pdf">Духовой шкаф Grundig GEBM19300BC. Инструкция (User Manual)</a>\r\n\r\n<a href="http://185.224.132.110/wp-content/uploads/2021/02/Shema-vstraivaniya-polnorazmernyh-duhovyh-shkafov.pdf">Схема встраивания полноразмерных духовых шкафов</a>";}i:2;a:3:{s:5:"title";s:16:"Гарантия";s:2:"id";s:9:"garantiya";s:7:"content";s:243:"Гарантия на бытовую технику Grundig составляет 2 года\r\n\r\nПодробнее об условиях принятия в гарантийное обслуживание в разделе «Гарантия»";}i:3;a:3:{s:5:"title";s:10:"Видео";s:2:"id";s:5:"video";s:7:"content";s:75:"[embed]https://youtu.be/M4r4z3jw_P8[/embed]\r\n\r\nhttps://youtu.be/H49MUceJqno";}}'),
