(1, 'admin', '$P$BJUParg4R1MaP5aZ9aWHiCdyxbwYe8/', 'admin', 'info@info.com', 'http://185.224.132.110', '2021-02-11 16:39:46', '', 0, 'admin');
INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `icon`) VALUES
(1, 'wc-admin-manage-store-activity-from-home-screen', 'info', 'en_US', 'Новое! Отслеживайте активность в магазине с главной страницы', 'Приступайте к работе, зная, что следует делать с заказами, товарами и отзывами покупателей.<br /><br />Узнайте больше о том, как использовать панели действий на главной странице.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-11 18:36:22', NULL, 0, 'plain', '', 0, 'info'),
(2, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Зарегистрируйтесь, чтобы получать советы, обновления продуктов и новые идеи', 'Мы готовы вам помочь — получайте советы, новости о продуктах и вдохновляющие идеи прямо на почту.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-11 18:36:23', NULL, 0, 'plain', '', 0, 'info'),
(3, 'wc-admin-marketing-intro', 'info', 'en_US', 'Найдите свою аудиторию', 'Расширяйте базу заказчиков и увеличивайте продажи с помощью маркетинговых инструментов для WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-11 18:36:23', NULL, 0, 'plain', '', 0, 'info'),
(4, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href="https://wordpress.com/support/concierge-support/">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(5, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(6, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(7, 'wcpay-promo-2020-11', 'marketing', 'en_US', 'Manage subscriber payments from your store''s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Payments</a>  – now supporting <a href="https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking "Install now," you agree to our <a href="https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(8, 'wcpay-subscriptions-2020-11', 'marketing', 'en_US', 'Manage subscriber payments from your store''s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Payments</a>  – now supporting <a href="https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking "Install now," you agree to our <a href="https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(9, 'wcpay-promo-2020-12', 'marketing', 'en_US', 'Get 50% off transaction fees with WooCommerce Payments', 'Keep more of your hard-earned cash by adding <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20" target="_blank">WooCommerce Payments</a> to your store. Lock in a discounted rate of 1.5% + $0.15 for $25,000 of payments (or three months, whichever comes first). Limited time offer – don’t miss out! <br /><br /><em>By clicking "Install now," you agree to our promotional <a href="https://woocommerce.com/terms-conditions/woocommerce-payments-promotion/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20" target="_blank">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(10, 'wcpay-subscriptions-2020-12', 'marketing', 'en_US', 'Manage payments from your store''s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">WooCommerce Payments</a>! Zero setup fees or monthly fees. Just pay-as-you-go, starting at just 2.9% + $0.30 per transaction for U.S.-issued cards. <br /><br /><em>By clicking "Install now," you agree to our <a href="https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20" target="_blank">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(11, 'wc-admin-getting-started-in-ecommerce', 'info', 'en_US', 'Getting Started in eCommerce - webinar', 'We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(12, 'your-first-product', 'info', 'en_US', 'Your first product', 'That''s huge! You''re well on your way to building a successful online store — now it’s time to think about how you''ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href="https://href.li/?https://woocommerce.com/shipping" target="_blank">WooCommerce Shipping</a>.', '{}', 'pending', 'woocommerce.com', '2021-01-26 00:36:23', NULL, 0, 'plain', '', 0, 'info'),
(13, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Подключиться к WooCommerce.com', 'Подключайтесь, чтобы получать важные уведомления о продукте и обновления.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-11 18:36:23', NULL, 0, 'plain', '', 0, 'info'),
(14, 'storefront-customize', 'info', 'en_US', 'Design your store with Storefront ', 'Visit the Storefront settings page to start setup and customization of your shop.', '{}', 'unactioned', 'storefront', '2021-02-11 19:02:52', NULL, 0, 'plain', '', 0, 'info'),
(15, 'wc-admin-filter-by-product-variations-in-reports', 'info', 'en_US', 'Новинка: фильтрация по разновидностям товаров в заказах и отчётах о продуктах', 'Стала доступна одна из самых долгожданных функций! Теперь у вас есть информация обо всех разновидностях товаров в заказах и отчётах о продуктах.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-13 14:11:00', NULL, 0, 'banner', 'http://185.224.132.110/wp-content/plugins/woocommerce/packages/woocommerce-admin/images/admin_notes/filter-by-product-variations-note.svg', 0, 'info'),
(16, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Выбираете тему?', 'Узнайте, какие темы совместимы с WooCommerce и выберите ту, что подойдёт под стиль и требования вашего бизнеса.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-13 14:11:00', NULL, 0, 'plain', '', 0, 'info'),
(17, 'wc-admin-insight-first-product-and-payment', 'survey', 'en_US', 'Совет', 'Более 80 % новых продавцов добавляют первый товар и настраивают хотя бы один способ оплаты в первую неделю. Мы всегда готовы помочь вам развивать бизнес! Вам пригодилась эта информация?', '{}', 'unactioned', 'woocommerce-admin', '2021-02-13 14:11:00', NULL, 0, 'plain', '', 0, 'info'),
(18, 'facebook_pixel_api_2021', 'marketing', 'en_US', 'Improve the performance of your Facebook ads', 'Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved performance and measurement of your Facebook ad campaigns.', '{}', 'pending', 'woocommerce.com', '2021-01-30 14:11:00', NULL, 0, 'plain', '', 0, 'info'),
(19, 'facebook_ec_2021', 'marketing', 'en_US', 'Sync your product catalog with Facebook to help boost sales', 'A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.', '{}', 'pending', 'woocommerce.com', '2021-01-30 14:11:00', NULL, 0, 'plain', '', 0, 'info'),
(20, 'wc-square-apple-pay-boost-sales', 'marketing', 'en_US', 'Boost sales with Apple Pay', 'Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.', '{}', 'pending', 'woocommerce.com', '2021-01-30 14:11:01', NULL, 0, 'plain', '', 0, 'info'),
(21, 'wc-square-apple-pay-grow-your-business', 'marketing', 'en_US', 'Grow your business with Square and Apple Pay ', 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.', '{}', 'pending', 'woocommerce.com', '2021-01-30 14:11:01', NULL, 0, 'plain', '', 0, 'info'),
(22, 'wc-admin-mobile-app', 'info', 'en_US', 'Установите мобильное приложение Woo', 'Установите мобильное приложение WooCommerce для управления заказами, получения уведомлений о продажах и просмотра ключевых показателей — где бы вы ни находились.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-13 19:42:25', NULL, 0, 'plain', '', 0, 'info'),
(23, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', 'Начните принимать платежи в своем магазине!', 'Принимайте платежи в удобной для вас системе — вам доступны более 100 платежных шлюзов для WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-17 06:01:43', NULL, 0, 'plain', '', 0, 'info'),
(24, 'wc-admin-optimizing-the-checkout-flow', 'info', 'en_US', 'Optimizing the checkout flow', 'It''s crucial to get your store''s checkout as smooth as possible to avoid losing sales. Let''s take a look at how you can optimize the checkout experience for your shoppers.', '{}', 'pending', 'woocommerce.com', '2021-02-03 21:01:44', NULL, 0, 'plain', '', 0, 'info'),
(25, 'wc-admin-first-five-things-to-customize', 'info', 'en_US', 'The first 5 things to customize in your store', 'Deciding what to start with first is tricky. To help you properly prioritize, we''ve put together this short list of the first few things you should customize in WooCommerce.', '{}', 'pending', 'woocommerce.com', '2021-02-03 21:01:44', NULL, 0, 'plain', '', 0, 'info'),
(26, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Помогите WooCommerce стать лучше, согласившись делиться данными об использовании.', 'Сбор данных об использовании позволяет нам улучшить WooCommerce. Информация о вашем магазине будет использоваться для оценки новых функций, определения качества обновлений и принятия решений о целесообразности дальнейших улучшений. Вы всегда можете зайти в <a href="http://185.224.132.110/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com" target="_blank">Настройки</a> и выбрать отмену отправки ваших данных. <a href="https://woocommerce.com/usage-tracking" target="_blank">Читать подробнее</a> о том, какие данные мы собираем.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-18 18:36:26', NULL, 0, 'plain', '', 0, 'info'),
(27, 'wc-admin-store-notice-giving-feedback-2', 'info', 'en_US', 'Приглашаем вас поделиться опытом', 'Теперь, когда мы стали вашим партнером, мы постараемся обеспечить вас всеми необходимыми инструментами. Ждем ваш отзыв о процессе настройки магазина. Он поможет нам оптимизировать его в будущем.', '{}', 'unactioned', 'woocommerce-admin', '2021-02-19 18:36:52', NULL, 0, 'plain', '', 0, 'info'),
(28, 'wc-admin-insight-first-sale', 'survey', 'en_US', 'Знаете ли вы?', 'В среднем магазину на базе WooCommerce требуется 31 день, чтобы получить первый заказ. Вы на правильном пути! Вам пригодилась эта информация?', '{}', 'unactioned', 'woocommerce-admin', '2021-02-19 18:36:52', NULL, 0, 'plain', '', 0, 'info'),
(29, 'wc-admin-effortless-payments-by-mollie', 'info', 'en_US', 'Effortless payments by Mollie', 'Offer global and local payment methods, get onboarded in minutes and supported in your language – try it now!', '{}', 'pending', 'woocommerce.com', '2021-02-13 18:36:47', NULL, 0, 'plain', '', 0, 'info');
